function Multiply(number, multiplier) {
    if(!number) return new Error("[Number] No Number Specified")
    if(isNaN(number)) return new Error("[Number] Number, No Letters Or Symbols")
    if(!multiplier) return new Error("[Multiplier] No Multiplier Specified")
    if(isNaN(number)) return new Error("[Multiplie] Number, No Letters Or Symbols")
    return number * multiplier;
}

module.exports = Multiply